import React from "react";
import { ArrowRight, ArrowDown, Search, Star, Minus } from "../../common/Svg/Svg";

import "../Form/Form.scss";



export default function Form() {

    return (
        <div className="footer__form">
            <div className="footer__form-title">SUBSCRIBE TO NEWSLETTER</div>
            <div className="footer__form-container">
                <input type="email" placeholder="Email" className="input" />
                <button className="button button--send"><ArrowRight className="arrow-svg" /></button>
            </div>
        </div>
    )
}
